;; **
;;; ## PDFA object
;; **

;; @@
(defn pdfa-states [pdfa]
  (keys (:edges pdfa)))

(defn pdfa-edges [pdfa]
  (let [t (:edges pdfa)]
    (into {} (map (fn [state]
                    [state (vec (set (vals (get t state))))])
                  (keys t)))))

(defn pdfa-node->descriptor [pdfa]
   (fn [node]
     {:label (str node)}))

(defn pdfa-edge->descriptor [pdfa]
  (fn [state nextstate]
    (let [edges (get-in pdfa [:edges state])
          probs (get-in pdfa [:probs state])
          
          emissions (filter #(= nextstate (get edges %))
                            (keys edges))
          probs (into {}
                      (map #(vector % (get probs %))
                           emissions))]
      {:label (clojure.string/join "|" (map #(format "%.3f%s"(get probs %) %)
                                            emissions))})))

(defn view-pdfa [pdfa]
  (rhizome.viz/view-graph (pdfa-states pdfa)
                          (pdfa-edges pdfa)
                          :node->descriptor (pdfa-node->descriptor pdfa)
                          :edge->descriptor (pdfa-edge->descriptor pdfa)))

(defn pdfa-image [pdfa]
  (rhizome.viz/graph->image (pdfa-states pdfa)
                          (pdfa-edges pdfa)
                          :node->descriptor (pdfa-node->descriptor pdfa)
                          :edge->descriptor (pdfa-edge->descriptor pdfa)))

(defn view-top-n-pdfas [states n]
  (let [top-n-states (take n (sort-by second > (vec (empirical-distribution (collect-results states)))))]
    (mapv #(vector (image-view (pdfa-image (first %))) (second %)) top-n-states)))
