(with-primitive-procedures [normalize]
  (defquery even [observedsequence alphabet]
    (let [num-states 2

          emissiondist (fn [state] 
                         (if (= state 0)
                           (categorical [["a" 0.5] ["b" 0.5]])
                           (categorical [["a" 0.0] ["b" 1.0]]))) ; \pi

          transition (fn [state symbol]
                       (case [state symbol]
                         [0 "a"] 0
                         [0 "b"] 1
                         [1 "a"] 0
                         [1 "b"] 0)) ; \delta
          ]

      (loop [obs observedsequence
             state [0]]
        (if (not (empty? obs))
          (let [currentstate (peek state)
                _ (observe (emissiondist currentstate) (first obs))
                nextstate (transition currentstate (first obs))]
            (recur (rest obs)
                   (conj state nextstate)))
          (new-pdfa alphabet num-states transition emissiondist))))))

(def num-particles 1)
(def is-states (take num-particles (infer :importance even [test-observations-str alphabet])))
