;; **
;;; Perplexity plots
;; **

;; @@
(defn perplexity [data anglican-state & {:keys [base]
                                         :or {base 2}}]
  (let [edges (:edges (:result anglican-state))
        probs (:probs (:result anglican-state))

        transition (fn [state symbol] ((edges state) symbol))
        emission-dist (fn [state] (categorical (vec (probs state))))

        log-prob-base-e (loop [data data
                               states [0]
                               log-prob 0]
                          (if (empty? data)
                            log-prob
                            (let [current-state (peek states)
                                  current-symbol (first data)
                                  next-state (transition current-state current-symbol)
                                  current-log-prob (observe* (emission-dist current-state) current-symbol)]
                              (recur (rest data)
                                     (conj states next-state)
                                     (+ log-prob current-log-prob)))))
        log-prob (/ log-prob-base-e (Math/log base))
        ]
    (Math/pow base (/ (- log-prob) (count data)))))

(defn map-state [anglican-states]
  (first (sort-by :log-weight > anglican-states)))

(defn run-experiment [algorithm num-particles-list num-trials]
  (mapv (fn [num-particles]
          (let [calculate-perplexity (fn []
                                       (let [states (case algorithm
                                                      :csis (take num-particles (infer :csis pdfa [test-observations-str alphabet] :observe-embedder-input test-observations))
                                                      :importance (take num-particles (infer :importance pdfa [test-observations-str alphabet]))
                                                      :smc (take num-particles (infer :smc pdfa [test-observations-str alphabet] :number-of-particles num-particles))
                                                      (throw (Exception. (str "can't run algorithm with algorithm " algorithm))))]
                                         (perplexity test-observations-str (map-state states))))
                perplexities (vec (repeatedly num-trials calculate-perplexity))]
            {:num-particles num-particles :perplexities perplexities}))
        num-particles-list))

(defn experiment-result->str [experiment-result]
  (clojure.string/join
    "\n"
    (map (fn [row]
           (str (:num-particles row) ","
                (clojure.string/join "," (:perplexities row))))
         experiment-result)))
